import { FINISH_CREATE_QUIZ, CREATE_QUIZ_QUESTION } from "./actionTypes"
import axios from "../../axios/axios-quiz"

export function createQuizQuestion(item) {
    return {
        type: CREATE_QUIZ_QUESTION,
        item
    }
}

export function finishCreateQuiz() {
    return async dispatch => {
        await axios.post("https://react-quiz-9637e.firebaseio.com/quizes.json", this.props.quiz)
    }
}
